        "#f\n",
        "survive = df[df['Survived'] == 1]\n",
        "oldest= 0\n",
        "youngest = df['Age'].max()\n",
        "total = 0\n",
        "cnt = 0\n",
        "\n",
        "for i in survive['Age']:\n",
        "    if not pd.isnull(i):\n",
        "        if i > oldest:\n",
        "            oldest = i\n",
        "        if i < youngest:\n",
        "            youngest = i\n",
        "        total += i\n",
        "        cnt += 1\n",
        "\n",
        "if cnt > 0:\n",
        "    avg = total / cnt\n",
        "else:\n",
        "    avg = 0\n",
        "\n",
        "print(\"Oldest\", oldest)\n",
        "print(\"Youngest\", youngest)\n",
        "print(\"Average\", avg)\n"
